import { useDispatch } from "react-redux";
import { fetchHolidays } from "./store/index";
const HolidayData = () => {
  const Calendarific = require("calendarific");
  const dispatch = useDispatch();

  // Initlize with an API key
  const clapi = new Calendarific("c7297e49e430234f8e0cd0ca2e79b304d476153a");

  const parameters = {
    country: "PK",
    year: 2019,
  };

  clapi.holidays(parameters, function async(data) {
    console.log(data);
    // Insert awesome code here...
    //dispatch(fetchHolidays.display(data));
    dispatch(fetchHolidays.holidaysFetched(data));
  });
  return <div>HolidayData</div>;
};

export default HolidayData;
